import React, { Component } from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Login from "./component/Login/Login";
import SignUp from './component/Login/SignUp'
import Topbar from '../src/component/Navbar/newNavbar'
import Dashboard from '../src/component/DashBoard/ListOfFriends'
import Chat from '../src/component/chatPage/Dashboard'
import Store from '../src/component/chatPage/Store'
class App extends Component {
  render() {
    return (
      <>
      {/* <Topbar></Topbar> */}
      <BrowserRouter>
               {/* <Topbar></Topbar> */}

        <Switch>
                 {/* <Topbar></Topbar> */}


          <Route path="/" component={Login} exact = {true} />
         <Route path = "/signup" component = {SignUp}/>
         {/* <Topbar></Topbar> */}
         <Route path = "/abc" component = {Dashboard}/>

         <Route path = "/chat" component = {Chat}/>
        </Switch>
      </BrowserRouter>
      </>
    );
  }
}

export default App;
